import React from 'react'
import ItemDif from '../ItemDetails/ItemDif/ItemDif'
const CreateYours = () => {
  const pagename="create Yours";
  return (
    <div className='createyours'>
      <ItemDif pagename={pagename}/>
    </div>
  )
}

export default CreateYours
